using Grpc.Core;
using Grpc.Net.Client;
using GrpcService.Protos;
using System;
using System.Collections.Concurrent;
using System.Collections.Generic;
using System.Diagnostics;
using System.Net.Http;
using System.Text;
using System.Threading.Tasks;
using MediaTypeHeaderValue = System.Net.Http.Headers.MediaTypeHeaderValue;

namespace Test
{
    public class Test
    {
        private const string GrpcUrl = "https://localhost:6001";
        private const string WebApiUrl = "https://localhost:6002";
        private const string GrpcConsoleAppUrl = "localhost:6003";
        //private const string GrpcUrl = "https://192.168.234.234:6001";
        //private const string WebApiUrl = "https://192.168.234.234:6002";
        //private const string GrpcConsoleAppUrl = "192.168.234.234:6003";

        private const string TestText =
            "data:image/png;base64,**";


        private int Count { get; }

        public Test(int count)
        {
            Count = count;
        }

        public HttpClientHandler GetHttpClientHandler()
        {
            // 跳过证书验证
            // ref:https://docs.microsoft.com/en-us/aspnet/core/grpc/troubleshoot?view=aspnetcore-3.0
            var httpClientHandler = new HttpClientHandler();
            // Return `true` to allow certificates that are untrusted/invalid
            httpClientHandler.ServerCertificateCustomValidationCallback =
                HttpClientHandler.DangerousAcceptAnyServerCertificateValidator;
            return httpClientHandler;
        }

        public async Task TestGrpc(List<long> list)
        {
            for (var index = 0; index < Count; index++)
            {
                var watch = Stopwatch.StartNew();
                watch.Start();
                using (var channel = GrpcChannel.ForAddress(GrpcUrl, new GrpcChannelOptions
                {
                    HttpClient = new HttpClient(GetHttpClientHandler())
                }))
                {
                    var client = new User.UserClient(channel);
                    var response = await client.SayHiAsync(new SayHiRequest
                    {
                        Name = $"{TestText}{index}"
                    });
                    //Console.WriteLine(response.Message);
                }

                watch.Stop();
                list.Add(watch.ElapsedMilliseconds);
            }
        }



        public async Task TestGrpcConsoleApp(List<long> list)
        {
            for (var index = 0; index < Count; index++)
            {
                var watch = Stopwatch.StartNew();
                watch.Start();
                var channel = new Channel(GrpcConsoleAppUrl, ChannelCredentials.Insecure);

                var client = new User.UserClient(channel);
                var response = await client.SayHiAsync(new SayHiRequest
                {
                    Name = $"{TestText}{index}"
                });
                //Console.WriteLine(response.Message);

                watch.Stop();
                list.Add(watch.ElapsedMilliseconds);
            }
        }

        public async Task TestWebApi(List<long> list)
        {
            for (var index = 0; index < Count; index++)
            {
                var watch = Stopwatch.StartNew();
                watch.Start();
                using (var client = new HttpClient(GetHttpClientHandler()) {BaseAddress = new Uri(WebApiUrl)})
                {
                    var httpContent = new StringContent("{ 'name': '" + TestText + index + "'}", Encoding.UTF8);
                    httpContent.Headers.ContentType = new MediaTypeHeaderValue("application/json");
                    var response = await client.PostAsync($"user/hi2", httpContent);
                    //Console.WriteLine(response.Content.ReadAsStringAsync().Result);
                }

                watch.Stop();
                list.Add(watch.ElapsedMilliseconds);
            }
        }

        public async Task TestGrpcSingleConnection(List<long> list)
        {
            using (var channel = GrpcChannel.ForAddress(GrpcUrl, new GrpcChannelOptions
            {
                HttpClient = new HttpClient(GetHttpClientHandler())
            }))
            {
                var client = new User.UserClient(channel);
                for (var index = 0; index < Count; index++)
                {
                    var watch = Stopwatch.StartNew();
                    watch.Start();
                    var response = await client.SayHiAsync(new SayHiRequest
                    {
                        Name = $"{TestText}{index}"
                    });
                    //Console.WriteLine(response.Message);
                    watch.Stop();
                    list.Add(watch.ElapsedMilliseconds);
                }
            }
        }

        public async Task TestGrpcConsoleAppSingleConnection(List<long> list)
        {
            var channel = new Channel(GrpcConsoleAppUrl, ChannelCredentials.Insecure);
            var client = new User.UserClient(channel);

            for (var index = 0; index < Count; index++)
            {
                var watch = Stopwatch.StartNew();
                watch.Start();
                var response = await client.SayHiAsync(new SayHiRequest
                {
                    Name = $"{TestText}{index}"
                });
                //Console.WriteLine(response.Message);

                watch.Stop();
                list.Add(watch.ElapsedMilliseconds);
            }
        }

        public async Task TestWebApiSingleConnection(List<long> list)
        {
            using (var client = new HttpClient(GetHttpClientHandler()) {BaseAddress = new Uri(WebApiUrl)})
            {
                for (var index = 0; index < Count; index++)
                {
                    var watch = Stopwatch.StartNew();
                    watch.Start();

                    var httpContent = new StringContent("{ 'name': '" + TestText + index + "'}", Encoding.UTF8);
                    httpContent.Headers.ContentType = new MediaTypeHeaderValue("application/json");
                    var response = await client.PostAsync($"user/hi2", httpContent);
                    //Console.WriteLine(response.Content.ReadAsStringAsync().Result);

                    watch.Stop();
                    list.Add(watch.ElapsedMilliseconds);
                }
            }
        }

        public async Task TestGrpcConcurrency(ConcurrentBag<long> list)
        {
            Parallel.For(0, Count, async (index, body) =>
            {
                var watch = Stopwatch.StartNew();
                watch.Start();
                using (var channel = GrpcChannel.ForAddress(GrpcUrl, new GrpcChannelOptions
                {
                    HttpClient = new HttpClient(GetHttpClientHandler())
                }))
                {
                    var client = new User.UserClient(channel);
                    var response = await client.SayHiAsync(new SayHiRequest
                    {
                        Name = $"{TestText}{index}"
                    });
                }

                //Console.WriteLine(response.Message);
                watch.Stop();
                list.Add(watch.ElapsedMilliseconds);
            });
        }

        public async Task TestWebApiConcurrency(ConcurrentBag<long> list)
        {
            Parallel.For(0, Count, async (index, body) =>
            {
                var watch = Stopwatch.StartNew();
                watch.Start();
                using (var client = new HttpClient(GetHttpClientHandler()) {BaseAddress = new Uri(WebApiUrl)})
                {

                    var httpContent = new StringContent("{ 'name': '" + TestText + index + "'}", Encoding.UTF8);
                    httpContent.Headers.ContentType = new MediaTypeHeaderValue("application/json");
                    var response = await client.PostAsync($"user/hi2", httpContent);
                    //Console.WriteLine(response.Content.ReadAsStringAsync().Result);
                }

                watch.Stop();
                list.Add(watch.ElapsedMilliseconds);
            });
        }


        public async Task TestGrpcConsoleAppConcurrency(ConcurrentBag<long> list)
        {
            Parallel.For(0, Count, async (index, body) =>
            {
                var watch = Stopwatch.StartNew();
                watch.Start();

                var channel = new Channel(GrpcConsoleAppUrl, ChannelCredentials.Insecure);
                var client = new User.UserClient(channel);
                var response = await client.SayHiAsync(new SayHiRequest
                {
                    Name = $"{TestText}{index}"
                });

                //Console.WriteLine(response.Message);
                watch.Stop();
                list.Add(watch.ElapsedMilliseconds);
            });
        }
    }
}
